package formes;

public class Point {

	Double x;
	Double y;
	public Point() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Point(Double x, Double y) {
		super();
		this.x = x;
		this.y = y;
	}
	@Override
	public String toString() {
		return "Point[x=" + x + ", y=" + y + "]";
	}
	
	
}
